import React, { Component } from 'react';
import Navbar from './Navbar';
import RecipeList from './RecipeList';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      Name: "Mohib"
    }
  }

  render(){
    return(
      <div>
      <Navbar /> 
      <RecipeList />
      </div>
    );
  }
}

export default App;
